      title={lst[2].title} 
      amount={lst[2].amount} 
      date={lst[2].date}>
      </ExpenseItem>
      <ExpenseItem 
      title={lst[3].title} 
      amount={lst[3].amount} 
      date={lst[3].date}>
      </ExpenseItem>
      


        </div>
    );

}

